// MovieList.js
import React from "react";
import MovieCard from "./MovieCard";

function MovieList({ movies, setSelectedMovie }) {
    return (
        <div className="movie-list">
            {movies.map((movie) => (
                <MovieCard
                    key={movie.id}
                    movie={movie}
                    onClick={() => setSelectedMovie(movie)}
                />
            ))}
        </div>
    );
}

export default MovieList;
